const Contents = () => {
  const [activeCategory, setActiveCategory] = useState("life");
  const [sortOrder, setSortOrder] = useState("popular");
  const [contentData, setContentData] = useState([]);
  const [page, setPage] = useState(1);
  const [loading, setLoading] = useState(false);

  const loader = useRef(null);
  const observer = useRef(null);

  const fetchData = useCallback(async () => {
    setLoading(true);

    setTimeout(() => {
      const newContent = contentsData[activeCategory].slice(
        (page - 1) * 15,
        page * 15
      );
      setContentData((prev) => [...prev, ...newContent]);
      setLoading(false);
    }, 300);
  }, [page, activeCategory]);

  const handleObserver = useCallback(
    (entries) => {
      const target = entries[0];
      if (target.isIntersecting && !loading) {
        setPage((prev) => prev + 1);
      }
    },
    [loading]
  );

  useEffect(() => {
    observer.current = new IntersectionObserver(handleObserver, {
      root: null,
      rootMargin: "20px",
      threshold: 1.0,
    });
    if (loader.current) {
      observer.current.observe(loader.current);
    }

    return () => {
      if (loader.current) {
        observer.current.unobserve(loader.current);
      }
    };
  }, [handleObserver]);

  useEffect(() => {
    setContentData([]);
    setPage(1);
  }, [activeCategory]);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  const handleCategoryClick = (category) => {
    setActiveCategory(category);
  };

  const handleSortOrderChange = (event) => {
    setSortOrder(event.target.value);
  };

  return (
    <ContentsWrapper>
      <Title></Title>
      <SelectContainer>
        <Categories>
          {Object.keys(contentsData).map((category) => (
            <CategoryButton
              key={category}
              active={activeCategory === category}
              onClick={() => handleCategoryClick(category)}
            >
              {category === "life"
                ? ""
                : category === "travel"
                ? ""
                : category === "culture"
                ? ""
                : category === "it"
                ? "IT"
                : category === "sports"
                ? ""
                : ""}
            </CategoryButton>
          ))}
        </Categories>
        <SortSelect value={sortOrder} onChange={handleSortOrderChange}>
          <option value="popular"></option>
          <option value="recent"></option>
        </SortSelect>
      </SelectContainer>
      <CardsContainer>
        {contentData.map((data, index) => (
          <AudioCard key={index} {...data} />
        ))}
      </CardsContainer>
      <div ref={loader} />
    </ContentsWrapper>
  );
};

export default Contents;

